column8:
フィット（DAA-GP5/6・DBR-GK3/4/5/6)フルオートエアコンディショナー装着車専用の保護シートです。<br>
エアコンパネルのキズやホコリ・紫外線からタッチパネルを守ります。<br>
光沢タイプで見た目が鮮やかで質感が上がります。指紋対策やキズ防止に。<br>
接着剤を使用していない特殊シリコーンの自己吸着タイプで、空気が抜けやすく気泡がのこりません。<br>
下地処理用の専用クロス付きです。<br><br>
<br>
